import React from 'react'
import Link from 'next/link'

const Nav = () => (
  <nav>
        <Link href="/">
          <a>Home</a>
        </Link>
        <Link href="/chart">
          <a>Chart</a>
        </Link>
        <Link href="/buttons">
          <a>Buttons</a>
        </Link>
        <Link href="/form">
          <a>Form</a>
        </Link>

    <style jsx>{`
      :global(body) {
        margin: 0;
        font-family: -apple-system, BlinkMacSystemFont, Avenir Next, Avenir,
          Helvetica, sans-serif;
      }
      nav {
        text-align: center;
        background-color: #2081b8;
        color: white;
        height: 70px;
      }
      a {
        color: white;
        text-decoration: none;
        font-size: 20px;
      }
    `}</style>
  </nav>
)

export default Nav
